xception Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Grid 2 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Grid 3 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Dark List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Shading Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Grid Accent 6\\\\\" ></w:LsdException>\r\n</w:LatentStyles></xml><![endif]--><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">要回答仿木纹地砖耐磨吗？首先要科普一下仿木纹砖的概念。仿木纹砖指表面呈木纹装饰图案的陶瓷砖。仿木纹砖从制作工艺上，分为两大类：釉面砖和劈开砖。釉面砖是通过丝网印刷工艺或贴陶瓷花纸的方法来使产品表面获得木纹图案。制作工艺比较简单；劈开砖是采用两种以上烧后呈不同颜色的坯料用针孔螺旋挤出机将材料螺旋混合后，再进行剖切出口形成的，酷似木材，其纹理贯通整块的瓷砖，制作工艺比较复杂。</span></span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">市面上的仿木纹砖大多数是</span></span><span><a href=\\\\\"http://www.hudson.com/xwzx/qyxw/2014-06-21/215.html\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\">釉面砖</span></span></a></span><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">，纹路逼真，质感舒适，没有木地板易褪色、不耐磨、保养难等缺点；而且纹理线条明快，可塑性高，图案长久清晰，本身具有阻燃，不易腐蚀等特点，寿命更长，更环保易打理。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p style=\\\\\"text-align: center;\\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;<img width=\\\\\"550\\\\\" height=\\\\\"368\\\\\" alt=\\\\\"仿木纹砖耐磨吗,仿木纹砖特点,仿木纹砖品牌.jpg\\\\\" src=\\\\\"/d/file/xwzx/qyxw/2015-04-02/d635947457cd97c56218c7677d349e43.jpg\\\\\" /></span></span></p>\r\n<p style=\\\\\"text-align: center;\\\\\" class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">而说到耐磨，仿木纹地砖耐磨吗？答案是肯定的。仿木纹砖本质是釉面砖，釉面采用丝网印刷工艺或贴陶瓷花纸的方法烧结到砖体表面，因为表面是釉面，所以耐磨程度不如</span></span><span><a href=\\\\\"http://www.hudson.com/cpyfw/zszx/2014-09-30/848.html\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\">抛光砖</span></span></a></span><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">。但由于其色彩图案丰富，而且防污能力强，仿木纹砖依旧被广泛用于墙面和地面装修。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">而且仿木纹砖因为有上釉，其表面强度会比通体砖（无上釉）强度和韧性都大很多，而且防渗性能好，十分耐脏；同时，作为釉面砖的一种，仿木纹砖的防滑性能也是非常好的</span><span style=\\\\\"font-family: 宋体;\\\\\">，因此，仿木纹砖无论在家装、工程、店铺装修中都应用十分广泛。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">说到</span></span><span><a href=\\\\\"http://www.hudson.com/xwzx/qyxw/2014-12-03/1458.html\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\">仿木纹砖哪个品牌好</span></span></a></span><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">，当数佛山哈德逊。作为佛山十大瓷砖品牌之一的佛山哈德逊，旗下的仿木纹砖种类包罗万有，有美式乡村风、现代中式风、田园风等，满足各种家居装修的需要。作为陶瓷电商领域的领导者，哈德逊瓷砖先后被评为&ldquo;中国名牌&rdquo;、&ldquo;瓷砖优质产品&rdquo;，并获得&ldquo;陶瓷行业领导品牌&rdquo;的荣誉，更在<font face=\\\\\"Times New Roman\\\\\">2014</font><font face=\\\\\"宋体\\\\\">年创下了年度全网销量领先的成绩，并在中国陶瓷卫浴行业网络风云榜评选中荣获&ldquo;最受网络关注电商品牌&rdquo;。哈德逊瓷砖将继续以产品创新、服务优质为中心，致力为广大消费者提供更好的产品与服务。</font></span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">文章来源：哈德逊瓷砖编辑原创</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">转载请注明出处</span></span><span style=\\\\\"font-size: 14px;\\\\\"><a href=\\\\\"http://www.hudson.com/\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">http://www.hudsonhome.cn<font face=\\\\\"宋体\\\\\">&ensp;</font></span></a></span></p>\r\n<p>&nbsp;</p>');");
